import { NgModule } from '@angular/core';
import { CommonModule } from '@angular/common';

//Components
import { PokerHeaderModule } from './poker-header/poker-header.module';



@NgModule({
  exports: [
    PokerHeaderModule
  ],
  imports: [
    CommonModule
  ]
})
export class SharedModule { }
